import styled from 'styled-components';
import IconButton from '@mui/material/IconButton';

export const Wraper = styled.div `
    margin: 40px;
`

export const StyledButton = styled(IconButton)`
    position: fixed;
    z-index: 100;
    right: 20px;
    top: 20px;
`
